import ReactDOM from 'react-dom';
// import './index.css';
import 'todomvc-common/base.css';
import 'todomvc-app-css/index.css';
import App from './App';

ReactDOM.render(
  <ConcurrentMode>
    <StrictMode>
      <App />
    </StrictMode>
  </ConcurrentMode>,
  document.getElementById('root')
